import Card from "../UI/Card";
import classes from "./AvailableMeals.module.css";
import MealItem from "./MealItem/MealItem";

const DUMMY_MEALS = [
  {
    id: "m1",
    name: "Veg. Pulao",
    description: "Finest rice and veggies",
    price: 70,
  },
  {
    id: "m2",
    name: "Shahi Paneer",
    description: "A Punjabi specialty!",
    price: 130,
  },
  {
    id: "m3",
    name: "Kaju Curry",
    description: "A delicious curry with cashews",
    price: 140,
  },
  {
    id: "m4",
    name: "Veg. Biryani",
    description:
      "Indian basmati rice with veggies and spices, served with raita",
    price: 150,
  },
];

const AvailableMeals = () => {
  const mealsList = DUMMY_MEALS.map((meal) => <MealItem key={meal.id} name={meal.name} description={meal.description} price = {meal.price} />);

  return (
    <section className={classes.meals}>
      <Card>
        <ul>{mealsList}</ul>
      </Card>
    </section>
  );
};

export default AvailableMeals;
